package blueprint_dto

import (
	"bytes"
	"context"
	"encoding/json"
	"fmt"
	"os"
	"time"

	"github.com/aadejanovs/catalog/database"
	"github.com/aadejanovs/catalog/internal/app/dtos"
)

type RedisRepository struct {
	client *database.Redis
}

func NewRedisRepository(r *database.Redis) *RedisRepository {
	return &RedisRepository{
		client: r,
	}
}

func (r *RedisRepository) Get(id string) (*dtos.BlueprintResponseDto, error) {
	var ctx = context.Background()

	val, err := r.client.Get(ctx, id).Result()
	if err != nil || val == "" {
		return nil, fmt.Errorf("record not found")
	}

	blueprintDto := &dtos.BlueprintResponseDto{}
	buff := bytes.NewBufferString(val)
	json.Unmarshal(buff.Bytes(), blueprintDto)

	return blueprintDto, nil
}

func (r *RedisRepository) Set(dto *dtos.BlueprintResponseDto) error {
	var ctx = context.Background()

	buff, err := json.Marshal(dto)
	if err != nil {
		return err
	}

	statusCmd := r.client.Set(ctx, dto.ID, string(buff), getCacheDuration())
	if statusCmd.Err() != nil {
		return statusCmd.Err()
	}

	return nil
}

func getCacheDuration() time.Duration {
	cacheDurationStr := os.Getenv("REDIS_CACHE_TTL")
	if cacheDurationStr == "" {
		fmt.Println("REDIS_CACHE_TTL not set")
		cacheDurationStr = "60s"
	}

	cacheDuration, err := time.ParseDuration(cacheDurationStr)
	if err != nil {
		fmt.Printf("Error parsing REDIS_CACHE_TTL: %s\n", err)
		return time.Second * 60
	}

	return cacheDuration
}

